webpackJsonp([89251070585984],{719:function(e,t){e.exports={data:{wordpressPost:{title:"BMJ Open in PubMed Central",content:'<p>This week <em>BMJ Open</em> received confirmation the journal has been accepted for inclusion in the NLM collection and so may deposit articles in <a href="http://www.ncbi.nlm.nih.gov/pmc/" target="_blank">PubMed Central</a> (PMC). This means that by publishing in <em>BMJ Open</em> authors will meet the requirements of major funders such as the <a href="http://www.wellcome.ac.uk/About-us/Policy/Policy-and-position-statements/WTD002766.htm" target="_blank">Wellcome Trust</a> by making their articles open access and ensuring their deposition in PMC.</p>\n<p>Another reason to publish in BMJ Open!<!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"BMJ PWA demo"}}},pathContext:{id:"90fdaaa6-2298-5c27-b9c5-abaa1a96766e"}}}});
